import "./App.css";

function App() {
  return (
    <div className="Title">
      <h1>Exchange Rate App</h1>
      <h2>
        This app, allows a user to put in a currency and a value and have it
        convert to another currency of a user's choice.
      </h2>
    </div>
  );
}

export default App;
